import { Button } from 'bootstrap';
import React from 'react';
import { Col, Container, Form, Jumbotron } from 'react-bootstrap';
import NavBa from './NavBar';

const Podmenu = () => {
    return (
        <Form>
            <Form.Row>
                <Col>
                <Form.Label>Název dotazníku</Form.Label>
                <Form.Control placeholder="Název" />
                </Col>
                <Col>
                <Form.Label>Autor dotazníku</Form.Label>
                <Form.Control placeholder="Autor" />
                </Col>
                <Button href='/album' variant="secondary">Zahájit tvorbu</Button>
            </Form.Row>
        </Form>
    )
}

const CreateS = () => (
    <Container className="p-1">
        <NavBa></NavBa>
        <Jumbotron>
            <h2>Vytvořit anketu</h2>
            <p>Nástroj pro tvorbu interaktvních anket se sběrem dat</p>
        </Jumbotron>
        <Podmenu />
    </Container>
);

export default CreateS;
